      </Box>
      <Typography variant="body1" sx={{ maxWidth: '60%' }}>
        The secret to a healthy heart is maintaining a balanced diet and regular exercise. Here are some key factors that help maintain a healthy heart...
      </Typography>
    </Paper>
  );
};

